function leadZero(num)
{
  if(num < 10) {
    num = '0' + num;
  }
  return num;
}

function timeConverter(UNIX_timestamp)
{
  var ddd = new Date(UNIX_timestamp * 1000);
  var y = ddd.getFullYear();
  
  var m = leadZero(ddd.getMonth() + 1);
  var d = leadZero(ddd.getDate());
  var h = leadZero(ddd.getHours());
  var i = leadZero(ddd.getMinutes());
  var s = leadZero(ddd.getSeconds());
  var time = parseInt('' + m + d + h + i + s);
  return time;
}

function getShortTime()
{
  const d = new Date();
  
  const OneJanuary2024 = new Date('January 01, 2024 00:00:00 UTC+00:00').getTime();

  const t = d.getTime();
  const tz = d.getTimezoneOffset();
  
  //const t1 = (t - constants.OneJanuary2000) / 1000;
  //const t1 = (t - OneJanuary2024) / 1000;
  const t1 = t / 1000;
  const t2 = (tz * -1) * 60;
  //const t2 = 0;
  const time = Math.round(t1 + t2);


  //console.log(timeConverter(t1));
  //console.log('time:', t, ', short time:', time, ', tz:', tz);

  return timeConverter(t1);
}

async function onEventSetLocalTime(type, data, device)
{
  if (data.type === 'attributeReport' && data.cluster === 'genTime') {
    try {  
      const endpoint = device.getEndpoint(1);
      time = getShortTime();
      //time = 1024;
      await endpoint.write('genTime', {time: time});
    } catch (error) {
      console.error("ERROR!", error);
      // endpoint.write can throw an error which needs to
      // be caught or the zigbee-herdsman may crash
      // Debug message is handled in the zigbee-herdsman
    }
  }
}

